/*Table structure for table `order1` */

DROP TABLE IF EXISTS `order1`;

CREATE TABLE `order1` (
  `ORDERID` varchar(250) NOT NULL,
  `SELLDATE` varchar(250) DEFAULT NULL,
  `BILLNAME` varchar(250) DEFAULT NULL,
  `BILLADDR1` varchar(250) DEFAULT NULL,
  `BILLADDR2` varchar(250) DEFAULT NULL,
  `BILLCITY` varchar(250) DEFAULT NULL,
  `BILLSTATE` varchar(250) DEFAULT NULL,
  `BILLZIP` varchar(250) DEFAULT NULL,
  `BILLPHONE` varchar(250) DEFAULT NULL,
  `SHIPNAME` varchar(250) DEFAULT NULL,
  `SHIPADDR1` varchar(250) DEFAULT NULL,
  `SHIPADDR2` varchar(250) DEFAULT NULL,
  `SHIPCITY` varchar(250) DEFAULT NULL,
  `SHIPSTATE` varchar(250) DEFAULT NULL,
  `SHIPZIP` varchar(250) DEFAULT NULL,
  `SHIPPHONE` varchar(250) DEFAULT NULL,
  `CREDITCARD` varchar(250) DEFAULT NULL,
  `CCNUM` varchar(250) DEFAULT NULL,
  `CCEXPIREMONTH` varchar(250) DEFAULT NULL,
  `CCEXPIREYEAR` varchar(250) DEFAULT NULL,
  `CARDHOLDER` varchar(250) DEFAULT NULL,
  `SHIPPINGMETHOD` int(11) NOT NULL,
  `PROFIT` double NOT NULL,
  `CUSTOMERID` varchar(250) DEFAULT NULL,
  PRIMARY KEY (`ORDERID`)
